"use strict";
// ----------Data Types---------
//* ========== Non-Premitive Types ==========
// string
var firstName = "Rahad";
// number
var roll = 2024;
// boolean
var isAdmin = true;
// undefined
var x = undefined;
// null
var y = null;
// any type
var z;
//* ========= Premitive Types ==========
// array
var friends = ['Suhag', 'Nazmul'];
var rolls = [102, 103];
// touple
// touple --> like array --> with order --> type of values
var person = ['Nazmul', 24];
// Object type
var user = {
    company: 'Programming Hero',
    firstName: 'Rahad',
    lastName: 'Ullah',
    isMarried: true
};
